import React from 'react'
import { Link } from 'react-router-dom'
function Logo(props) {
    return (
            <Link to="/">
            <h2 className=" pt-1 font-bold text-xl ">
                <span className="text-theme">{props.Seller} </span>| Aapki Dukaan </h2>
            </Link>
    )
}

export default Logo
